// 🚨 Injecting Custom XP + Sol Coin System + Rank Logic for Waylen

const fs = require("fs");

// ================= GLOBAL STORAGE ================= let userDB = {}; const DB_PATH = "./userdb.json"; // You can change where this saves

// Load or create DB if (fs.existsSync(DB_PATH)) { userDB = JSON.parse(fs.readFileSync(DB_PATH)); } else { fs.writeFileSync(DB_PATH, JSON.stringify(userDB, null, 2)); }

function saveDB() { fs.writeFileSync(DB_PATH, JSON.stringify(userDB, null, 2)); }

// ================= CORE DATA FUNCTIONS ================= function getUser(id) { if (!userDB[id]) { userDB[id] = { xp: 0, coins: 0, rank: "Newbie", premiumUntil: null }; } return userDB[id]; }

function setWaylen(id) { const u = getUser(id); u.xp = Infinity; u.coins = Infinity; u.rank = "Rank Waylen"; u.premiumUntil = "Infinity"; saveDB(); }

function addXP(id, amount) { const user = getUser(id); if (user.rank === "Rank Waylen") return; user.xp += amount; saveDB(); }

function addCoins(id, amount) { const user = getUser(id); if (user.rank === "Rank Waylen") return; user.coins += amount; saveDB(); }

function attemptPremium(id) { const user = getUser(id); if (user.rank === "Rank Waylen") return true; if (user.coins >= 100000) { user.coins -= 100000; const now = new Date(); const expire = new Date(now.setMonth(now.getMonth() + 1)); user.premiumUntil = expire; saveDB(); return true; } return false; }

function isPremium(id) { const user = getUser(id); if (user.rank === "Rank Waylen") return true; if (!user.premiumUntil) return false; return new Date() < new Date(user.premiumUntil); }

// ============= HOOK THIS INTO BOT EVENTS ============= module.exports = { getUser, addXP, addCoins, attemptPremium, isPremium, setWaylen };

